import styled from "styled-components";
import Texto from "../Texto";

const FooterStyle = styled.footer`
    display: flex;
    background-color: #FF3F00;
    height: 150px;
    flex-direction: column;
    justify-content: center;
    align-items: center;
    padding: 20px 90px;
    position: relative;

    @media (max-width: 600px) {
        flex-direction: column;
    }
`;

const LinksContainer = styled.div`
    display: flex;
    flex-direction: row;
    align-items: center;
    justify-content: center;
    gap: 40px;
`;

const Link = styled.a`
    color: black;
    text-decoration: none;
    font-size: 30px;
    transition: transform 0.3s ease;

    &:hover {
        transform: scale(1.1);
    }
`;

function Footer() {
    return (
        <FooterStyle>
            <LinksContainer>
                <Link href="https://github.com/GustavoAlvesm21/MoveX" >Reposit√≥rio MoveX</Link>
                <Link href="https://github.com/GustavoAlvesm21">GitHub: @ElismarSilva</Link>
                <Link href="https://github.com/ElismarSilva/MoveX/tree/master">GitHub: @GustavoAlvesm21</Link>
            </LinksContainer>
        </FooterStyle>
    );
}

export default Footer;
